import './App.css';
function App() {
  return (
    <div className=" main-box bg-[url(../public/img/w.jpg)] h-screen w-screen  flex flex-col flex-wrap justify-center items-center bg-no-repeat bg-cover bg-center bg-fixed ">      
      <div className='h-1/6 w-1/3  flex flex-col flex-wrap justify-center items-center'>
        <h1 className='text-3xl font-serif italic font-semibold'>Weather App</h1>
      </div>

      <div className="boxes weather-box w-1/3 h-3/6 border-2 rounded-lg">
        <input type="text" className='rounded-md' placeholder='city'/>
        <button className='bg-blue-200 hover:bg-blue-700 text-black font-bold rounded-md'>search</button>
        <p>City</p>
        <p>temperature</p>
        <div className='border-2 h-1/6 w-4/5 flex flex-wrap flex-col justify-between'>
          <p>65C</p>
          <p>feelslike</p>
          <p>1</p>
          <p>humidity</p>
          <p>2</p>
          <p>Windspeed</p>
        </div>
      </div>
    </div>
  );
}

export default App;
